STOPWORDS = frozenset(w for w in swords.split() if w)
STOPWORDS2 = frozenset(w for w in utils.to_unicode(swords).split() if w)
GOODWORDS = frozenset(w for w in gwords.split() if w)

def remove_stopwords(s):
    s = utils.to_unicode(s)
    return " ".join(w for w in s.split() if w not in STOPWORDS and w not in STOPWORDS2 and w in GOODWORDS)


RE_PUNCT = re.compile('([%s])+' % re.escape(string.punctuation), re.UNICODE)
def strip_punctuation(s):
    s = utils.to_unicode(s)
    return RE_PUNCT.sub(" ", s)


# unicode.translate cannot delete characters like str can
strip_punctuation2 = strip_punctuation
